import React from 'react';
import AirbnbStyleCalendar from './components/AirbnbStyleCalendar.js';

const HomePage = () => {
    const bookedDates = [
        new Date(2025, 1, 15), // February 15, 2025
        new Date(2025, 1, 16), // February 16, 2025
        new Date(2025, 2, 5),  // March 5, 2025
    ];

    return (
        <div>
            <h1>Welcome to the Home Page</h1>
            <AirbnbStyleCalendar bookedDates={bookedDates} />
        </div>
    );
};

export default HomePage;
